?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Данная компания начала функционировать примерно в 1920 году. Изначально, компания производила серийные автоматические часы. С момента основания компании, многое поменялось, однако, мастера до сих пор сохраняют традицию изготовления сложных механизмов для космонавтики или авиации. Например, в 1998 году, компанией Fortis был изобретен механизм, который сочетал в себе одновременно и хронограф, и будильник (такой механизм был единственным в мире). С конца 20-го века, Fortis начинает сотрудничество со многими специалистами из авиационной и космической отраслей. Интересно, что большинство моделей тестируются в специальных лабораториях и даже в открытом космосе. Хронографы, изготовленные компанией Fortis, стали очень популярны среди известных пилотов. Кроме «космических» часов, компания занимается и производством часов для летчиков (автоматических). Для того, чтобы убедиться в их качестве, достаточно взглянуть в их «послужной список» список международных наград, полученных компанией Fortis. Часы Fortis качество и надежность в сочетании с классическими традициями.</span></span></p>
 
